Show Nfo - A like-able Miami police forensics expert moonlights as a serial killer of criminals who he believes have escaped justice.   

More Nfo - Meet Dexter Morgan. By day he's a blood splatter pattern expert for the Miami Metro police department. But by night - he takes on an entirely different persona: serial killer. But Dexter isn't your average serial killer as he only kills people who fit a very prolific and precise &quot;moral code&quot; taught to him by his late father Harry (he didn't kill Harry, honest), and developed very thoroughly throughout each kill. While dealing with his daily activities and his boss, Sgt. Doakes, the one man who may or may not know the truth about his after-hours activities, he is given a friendly message by a guy referred to only as &quot;The Ice Truck Killer&quot; - a crime scene where there is no blood. This shocking discovery turns Dexter's world completely upside down. The Ice Truck Killer wants Dexter to play his game and Dexter is very eager to take on this cat-and-mouse chase throughout Miami.

Review - Dexter is hilarious; it is easily the best new show on TV! Dark, dry humor crops up in the most unexpected places, and the settings and dialogue are laced with CSI's pseudo-scientific appeal. While the show may appear to treat standard morality as irreverent, it is actually an excellent study of humanity at its best -- and worse.

The character of Dexter, a disassociated, psychopathic serial killer, is somewhat reminiscent of Data, the android in the Star Trek series. Dexter is devoid of normal, human emotion, and has to learn behaviors by rote. Seeing the world through his eyes enables us to closely examine what is &quot;right&quot; and what is &quot;wrong.&quot; We have to pause and wonder about our own perception of reality.

Overall, the show is a side-splitting outlet for the vigilante/serial killer/dysfunctional being in all of us. Well done!


